import React from "react";
import { Line } from "react-chartjs-2";
import { Chart, LineElement, PointElement, CategoryScale, LinearScale } from "chart.js";

Chart.register(LineElement, PointElement, CategoryScale, LinearScale);

export default function VIGraph({ data }) {
  const chartData = {
    labels: data.map(row => row.voltage),
    datasets: [
      {
        label: "VI Curve",
        data: data.map(row => row.current),
        borderWidth: 2,
        pointRadius: 0,       // Removes scatter dots
        tension: 0.4          // Smooth curve
      }
    ]
  };

  const options = {
    scales: {
      x: { title: { display: true, text: "Voltage (V)" } },
      y: { title: { display: true, text: "Current (A)" } }
    }
  };

  return <Line data={chartData} options={options} />;
}
